        </EachMiddle>
        <EachMiddle>
          <div className="for-img">
            <img src={QR} alt="QR" />
          </div>
          <p>
            Scan any <br /> QR code
          </p>
        </EachMiddle>
        <EachMiddle>
          <div className="for-img">
            <img src={QR} alt="QR" />
          </div>
          <p>
            Scan any <br /> QR code
          </p>
        </EachMiddle>
