          <div className="for-img">
            <img src={QR} alt="QR" />
          </div>
          <p>
            Recharge <br /> and bills
          </p>
        </EachMiddle>
      </MiddleFirst>
    </>
  );
}

const MiddleFirst = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
  text-align: center;
  font-size: 13px;
  padding: 10px 0;
  margin: 0 20px;
`;
